import Ndata from "./NdData";
import Slider from "react-slick";
const Carts = () => {
    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 1
        
      };
    return (
        <>
        <Slider {...settings}>
            <div className="grid product">
                {
                    Ndata.map((vale, index) =>{
                        return(
                            <div className="" key={index}>
                                <div className="img">
                                    <img src={vale.cover} alt="" />
                                </div>
                                <h4>{vale.name}</h4>
                                <span>{vale.price}</span>
                            </div>
                        )
                    } )
                }
            </div>
            </Slider>
        </>
    );
}

export default Carts;
